    <script>
        //on click of POS cell, open up email client with populated data
        $(document).on('click', 'td', function(e)
        {
            var cell = e.currentTarget.innerHTML; //get value of whatever td is clicked
            var row = e.currentTarget.closest('tr'); //find the row that the td is in
            var cells = row.getElementsByTagName('td'); // break row into td cells
            var POS = cells[0].innerHTML;  //find the cell that contains POS data
            if (cell == POS)    //only if POS cell was clicked
                {
                    //mailto:  %20 = space, %09 = tab , %0D%0A = return
                    window.location = "mailto:eiwalsh@cisco.com?subject=Please%20claim%20POS%20order-"+cells[0].innerHTML+"-"+cells[2].innerHTML+"&cc=jleatham@cisco.com&body=%0D%0AI%20believe%20this%20order%20should%20be%20credited%20to%20me.%20%20Details:%0D%0A%0D%0APOSID:%09:%09"+cells[0].innerHTML+"%0D%0ADATE:%09:%09"+cells[1].innerHTML+"%0D%0AMy%20CCOID:%09:%09"+cells[2].innerHTML+"%0D%0ACredited:%09:%09"+cells[3].innerHTML+"%0D%0AEnd%20customer:%09:%09"+cells[4].innerHTML+"%0D%0AShipped%20to:%09:%09"+cells[7].innerHTML+"%0D%0ASold%20to:%09:%09"+cells[8].innerHTML+"%0D%0AParty%20ID:%09:%09"+cells[9].innerHTML+"%0D%0AProduct%20ID:%09:%09"+cells[5].innerHTML+"%0D%0AValue:%09%09:%09"+cells[6].innerHTML+"%0D%0A";                    
                }
        });
        
    </script>
